window.bookSummaryJSON = "<p><i>Introducing the Custard Protocol series, in which Alexia Maccon's daughter, Prudence, travels to India on behalf of queen, country--and the perfect pot of tea.</i> </p> <p>When Prudence Alessandra Maccon Akeldama (\"Rue\" to her friends) is bequeathed an unexpected dirigible, she does what any sensible female under similar circumstances would do: she christens it the <i>Spotted Custard</i> and floats off to India. </p> <p>Soon she stumbles upon a plot involving local dissidents, a kidnapped brigadier's wife, and some awfully familiar Scottish werewolves. Faced with a dire crisis (and an embarrassing lack of bloomers), Rue must rely on her good breeding--and her metanatural abilities--to get to the bottom of it all. </p>"; 
